import React, { Component } from 'react';

import ButtonAdmin from '../../componentes/MenuButton/ButtonMenu';
import classes from '../AdminMenu/AdminMenu.css'
import {
    Link
} from "react-router-dom";

class AdminMenu extends Component {

    render() {
        return (
            <div className={classes['buttons']}>
                <Link to="/residentes">
                    <ButtonAdmin className={classes['button']} title='Residentes' logo='https://www.vhv.rs/dpng/d/217-2174722_admin-icon-png-transparent-png.png'></ButtonAdmin>
                </Link>
                <Link>
                    <ButtonAdmin className={classes['button']} title='admin' logo='https://www.vhv.rs/dpng/d/217-2174722_admin-icon-png-transparent-png.png'></ButtonAdmin>
                </Link>
                <Link>
                    <ButtonAdmin className={classes['button']} title='Registro Visitante' logo='https://www.vhv.rs/dpng/d/217-2174722_admin-icon-png-transparent-png.png'></ButtonAdmin>
                </Link>
                <Link>
                    <ButtonAdmin className={classes['button']} title='Portero' logo='https://www.vhv.rs/dpng/d/217-2174722_admin-icon-png-transparent-png.png'></ButtonAdmin>
                </Link>
            </div>
        )
    }
}

export default AdminMenu
